Defendant Kelsey L Breedlove in court with attorney Christian T Eichenlaub.  Jay R Pucek appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.    The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 60 months.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for30  months with credit for 5 days time served.  Defendant shall serve 30 months on EXTENDED SUPERVISION.The defendant is eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years.
 * Court ordered defendant to provide a DNA sample (unless previously provided and on file).

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No controlled substances or alcohol;
 - AODA assessment; treatment if needed;
 - Urine screens;
 - No contact with Brent K. or his family or their residence;
 - Pay $3,200.00 stipulated restitution to Brent K.  Should defendant get revoked and be sent to prison, the Court ordered monies taken from up to 25% of prison funds; balance to be paid while on extended supervision.  Failure to pay would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.
 - Seek and maintain employment;
 - Job and vocational training;
 - Cognitive thinking intervention counseling;
 - the Court imposed 8 months of condition time to be served as follows:  Serve 6 months at the House of Correction, with Huber for work; good time allowed.  Court stayed report date to 6/13/14 at 5:00 p.m.  60 days balance remaining to be stayed for use by the agent for any violations;
 - Pay the DNA surcharge,all  costs and disbursements after restitution has been paid.  Should defendant get revoked, Court ordered that monies be taken from prison funds not to exceed 25%.  Balance to be paid while on extended supervision.  Failure to pay would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.

